import React, { useEffect } from 'react';
import * as firebase from 'firebase/app';

import Api from './api';
import firebaseConfig from './firebaseConfig';

const App = () => {
  useEffect(() => {
    firebase.initializeApp(firebaseConfig)
  });
  const api = new Api();
  api.getMovies().then(console.log);
  return (
    <div>Test!</div>
  );
}

export default App;
